import React, {Component} from "react";
import HeaderReservas from "../template/HeaderReservas";
import { ApiurlUsers } from "../services/apirest";
import axios from 'axios';


class Reservaciones extends Component{

    state={
        reservations: []
    } ;


    clickReservation(id){
        this.props.history.push("/verreservaciones/"+ id);
    }


    
    componentDidMount(){
             let email = this.props.match.params.id;
            
            let url = ApiurlUsers + email + ("/reservations");
            axios.get(url)
            .then(response =>{
                this.setState({
                    users : response.data.users
                })
                
            })
    }

    render(){
        
        return(
               
            <React.Fragment>

              
                <HeaderReservas></HeaderReservas>
<br></br>
                <div className="container">
                    

                <table id="customers" className="table table-striped">
                    <thead>
                        <tr>
                        <th scope="col">Nombre del usuario</th>
                        <th scope="col">Correo electr√≥nico</th>
                        <th scope="col">Rol</th>
                        <th scope="col"></th>
                        </tr>
                    </thead>
                    <tbody> 
                        {this.state.users.map((value, index) => {
                           return (
                            <tr key={index} onClick={ () => this.clickUsers(value.contact.email)  }  >
                            <td>{value.name+" "+value.last_name}</td>
                            <td>{value.contact.email}</td>
                            <td>{value.role.name}</td>
                           
                            <td>
                                <button >
                                Editar
                                </button>
                                </td>
                            </tr>
                            )
                        })}
                         
                 
                    </tbody>
                    </table>
                    <div>
                        <a 
                        className="btn btn-success" 
                         href="/IngresarUsuario"
                         role="button"
                          style={{marginRight:"10px", float:"right"}}>
                            Ingresar usuario
                            </a>   
                     </div>
                </div>

                    
            </React.Fragment>
          
        );
    }

}


export default Reservaciones;
